tables.table_schema:
CREATE TABLE gene_expression_data (
    gene_id UUID PRIMARY KEY,
    tissue_type VARCHAR(255),
    expression_level FLOAT
);

CREATE TABLE gene_expression_data (
    gene_id INT PRIMARY KEY,
    gene_symbol TEXT,
    tissue_type TEXT,
    expression_level FLOAT
);

CREATE TABLE tissue_types (
    tissue_id INT PRIMARY KEY,
    tissue_name TEXT
);

CREATE TABLE Genes (
  gene_id INT PRIMARY KEY,
  gene_name VARCHAR(50) NOT NULL,
  tissue_type VARCHAR(50) NOT NULL,
  expression_level INT
);

CREATE TABLE Tissues (
  tissue_id INT PRIMARY KEY,
  tissue_name VARCHAR(50) NOT NULL,
  tissue_location VARCHAR(100) NOT NULL,
  sample_type VARCHAR(50)
);

CREATE TABLE Gene { 
     gene_id INT PRIMARY KEY, 
     gene_name VARCHAR(50), 
     tissue_sample VARCHAR(50), 
     expression_level FLOAT 
 }

CREATE TABLE Tissue { 
     tissue_id INT PRIMARY KEY, 
     tissue_name VARCHAR(50) 
 }

CREATE TABLE Sample { 
     sample_id INT PRIMARY KEY, 
     sample_name VARCHAR(50), 
     tissue_id INT 
 }

CREATE TABLE Experiment { 
     experiment_id INT PRIMARY KEY, 
     experiment_name VARCHAR(50), 
     researcher_name VARCHAR(50) 
 }
